import React, { useState, useEffect, useCallback } from 'react';
import {
  Table,
  Badge,
  Button,
  Modal,
  Form,
  Row,
  Col,
  InputGroup,
  FormControl,
} from 'react-bootstrap';
import { CalendarCheck, Pencil, Trash, CameraVideo, Search } from 'react-bootstrap-icons';
import { toast } from 'react-toastify';
import interviewService from '../../services/interviewService';

const InterviewList = ({ interviews: initialInterviews }) => {
  const [interviews, setInterviews] = useState(initialInterviews || []);
  const [filteredInterviews, setFilteredInterviews] = useState(initialInterviews || []);
  const [showModal, setShowModal] = useState(false);
  const [selectedInterview, setSelectedInterview] = useState(null);
  const [newStatus, setNewStatus] = useState('');
  const [searchTerm, setSearchTerm] = useState('');

  useEffect(() => {
    if (initialInterviews) {
      setInterviews(initialInterviews);
      setFilteredInterviews(initialInterviews);
    }
  }, [initialInterviews]);

  // Filter interviews based on search term (no scroll in table)
  useEffect(() => {
    if (!searchTerm.trim()) {
      setFilteredInterviews(interviews);
    } else {
      const lowerTerm = searchTerm.toLowerCase();
      setFilteredInterviews(
        interviews.filter(
          (interview) =>
            (interview.StudentName && interview.StudentName.toLowerCase().includes(lowerTerm)) ||
            (interview.StudentEmail && interview.StudentEmail.toLowerCase().includes(lowerTerm)) ||
            (interview.Interviewer && interview.Interviewer.toLowerCase().includes(lowerTerm)) ||
            (interview.Status && interview.Status.toLowerCase().includes(lowerTerm))
        )
      );
    }
  }, [searchTerm, interviews]);

  const getStatusVariant = useCallback(() => {
    return (status) => {
      const variants = {
        Invited: 'info',
        Scheduled: 'primary',
        Completed: 'success',
        Cancelled: 'danger',
        'No-Show': 'warning',
      };
      return variants[status] || 'secondary';
    };
  }, []);

  const handleStatusUpdate = useCallback((interview) => {
    setSelectedInterview(interview);
    setNewStatus(interview.Status);
    setShowModal(true);
  }, []);

  const submitUpdate = useCallback(async () => {
    if (!selectedInterview) return;
    try {
      await interviewService.updateStatus(selectedInterview.Id, newStatus);
      setInterviews((prev) =>
        prev.map((i) =>
          i.Id === selectedInterview.Id ? { ...i, Status: newStatus } : i
        )
      );
      toast.success('Interview status updated successfully');
      setShowModal(false);
    } catch {
      toast.error('Failed to update interview status');
    }
  }, [newStatus, selectedInterview]);

  const handleDelete = useCallback(async (id) => {
    if (window.confirm('Are you sure you want to delete this interview?')) {
      try {
        await interviewService.deleteInterview(id);
        setInterviews((prev) => prev.filter((i) => i.Id !== id));
        toast.success('Interview deleted successfully');
      } catch {
        toast.error('Failed to delete interview');
      }
    }
  }, []);

  const statusVariantFn = getStatusVariant();

  return (
    <>
      <Row className="mb-3 align-items-center">
        <Col xs="auto" className="d-flex align-items-center text-primary fs-5 fw-bold">
          <CalendarCheck className="me-2" />
          Scheduled Interviews
        </Col>
        <Col xs="auto">
          <Badge bg="info" pill>
            {filteredInterviews.length}
          </Badge>
        </Col>
        <Col xs={12} md={5} lg={4} className="mt-3 mt-md-0">
          <InputGroup>
            <InputGroup.Text>
              <Search />
            </InputGroup.Text>
            <FormControl
              placeholder="Search..."
              aria-label="Search interviews"
              value={searchTerm}
              onChange={(e) => setSearchTerm(e.target.value)}
              autoComplete="off"
            />
          </InputGroup>
        </Col>
      </Row>

      <Table striped bordered hover responsive className="mb-0 align-middle text-nowrap">
        <thead className="table-dark">
          <tr>
            <th>Student</th>
            <th>Email</th>
            <th>Slot Date &amp; Time</th>
            <th>Interviewer</th>
            <th>Status</th>
            <th>Meeting Link</th>
            <th style={{ width: 130 }}>Actions</th>
          </tr>
        </thead>
        <tbody>
          {filteredInterviews.length === 0 ? (
            <tr>
              <td colSpan="7" className="text-center py-4 text-muted">
                No interviews found.
              </td>
            </tr>
          ) : (
            filteredInterviews.map((interview) => (
              <tr key={interview.Id}>
                <td>{interview.StudentName}</td>
                <td>{interview.StudentEmail}</td>
                <td>{interview.SlotDateTime ? new Date(interview.SlotDateTime).toLocaleString() : '-'}</td>
                <td>{interview.Interviewer || '-'}</td>
                <td>
                  <Badge bg={statusVariantFn(interview.Status)} pill>
                    {interview.Status}
                  </Badge>
                </td>
                <td>
                  {interview.MeetingLink ? (
                    <Button
                      as="a"
                      href={interview.MeetingLink}
                      target="_blank"
                      rel="noopener noreferrer"
                      size="sm"
                      variant="outline-primary"
                      aria-label={`Join meeting for ${interview.StudentName}`}
                      className="d-flex align-items-center gap-1"
                    >
                      <CameraVideo />
                      Join
                    </Button>
                  ) : (
                    '-'
                  )}
                </td>
                <td>
                  <Button
                    size="sm"
                    variant="outline-secondary"
                    className="me-2"
                    onClick={() => handleStatusUpdate(interview)}
                    aria-label={`Update interview status for ${interview.StudentName}`}
                  >
                    <Pencil />
                    Update
                  </Button>
                  <Button
                    size="sm"
                    variant="outline-danger"
                    onClick={() => handleDelete(interview.Id)}
                    aria-label={`Delete interview for ${interview.StudentName}`}
                  >
                    <Trash />
                  </Button>
                </td>
              </tr>
            ))
          )}
        </tbody>
      </Table>

      <Modal
        show={showModal}
        onHide={() => setShowModal(false)}
        centered
        backdrop="static"
        keyboard={false}
        aria-labelledby="update-status-modal"
      >
        <Modal.Header closeButton>
          <Modal.Title id="update-status-modal">Update Interview Status</Modal.Title>
        </Modal.Header>
        <Modal.Body>
          <Form>
            <Form.Floating>
              <Form.Select
                id="interviewStatus"
                value={newStatus}
                onChange={(e) => setNewStatus(e.target.value)}
                aria-label="Select interview status"
              >
                <option value="Invited">Invited</option>
                <option value="Scheduled">Scheduled</option>
                <option value="Completed">Completed</option>
                <option value="Cancelled">Cancelled</option>
                <option value="No-Show">No-Show</option>
              </Form.Select>
              <Form.Label htmlFor="interviewStatus">Interview Status</Form.Label>
            </Form.Floating>
          </Form>
        </Modal.Body>
        <Modal.Footer>
          <Button variant="secondary" onClick={() => setShowModal(false)}>
            Cancel
          </Button>
          <Button variant="primary" onClick={submitUpdate}>
            Update
          </Button>
        </Modal.Footer>
      </Modal>
    </>
  );
};

export default InterviewList;
